window.bookSummaryJSON = "<p><i>An actor, a model, and a younger man walk into a therapist’s office.... They’re all Dylan Brodie. It’s only funny if you aren’t the single mom therapist he can’t stop flirting with.</i></p> <p><b>Dear Mr. Brodie,</b></p> <p>I hope this email finds you well.<br> Your well-being and personal growth are of the utmost importance to me, as a therapist.<br> As such, I have decided it is in your best interest to continue individual therapy with another practitioner.<br> This is due to the potential for boundaries being crossed between us.<br> Attached is a list of colleagues I would recommend for you.</p> <p>Sincerely,<br> Scarlett Shepard, MS, MFT</p> <p><b>Dear Scarlett,</b></p> <p>Cool.<br> Consider our sessions terminated.<br> Now I can tell you how beautiful you are and how attracted I am to you.<br> Let’s start crossing boundaries over dinner tonight.<br> You’ll say it would be unethical, and I’ll point out that we’ve only had a few sessions.<br> You’ll cite the age difference, and I’ll tell you how hot it is that you’re six years older than me.<br> You’ll say you’re a mom, and I’ll remind you that I think your son is awesome.<br> We don’t have to discuss my former attachments to former co-stars ever again.<br> This is due to the fact that clearly my only personality issue is that I’m irresistible.</p> <p>Yours in well-being and personal growth,<br> Dylan Brodie, W.M.H.T.A.T.Y.E.H. (Way More Handsome and Talented Actor Than Your Ex-Husband)</p> <p>This is a duet-style audiobook, starring Zachary Webber and Emily Woo Zeller. Featuring Jason Clarke, Teddy Hamilton, Mackenzie Cartwright, Connor Crais, and Emma Wilder.</p>"; 
